;; **
;;; ## Matrix utilities
;; **

;; @@
(defn matrix
  "Convert list of rows into matrix"
  [& args]
  (apply cm/matrix args))


(defn update-in-matrix
  "Updates locations of a matrix with the update-fn"
  [mat update-fn locs]
  (reduce
    (fn [m [i j]]
      (cm/mset m i j (update-fn (cm/mget m i j))))
    mat
    locs))

(defn test-update-in-matrix
  "Test for the `update-in-matrix` function"
  []
  (let [mat (matrix (repeat 5 (repeat 5 1)))
        new-mat (update-in-matrix mat
                                  (partial + 8)
                                  (map #(vector % %) (range 5)))]
    (println "OLD:\n" mat "\n\nNEW:\n" new-mat)))

