(defn truncated-random-normal
  "Samples a number from the positive half of a normal distribution (mean=0, std=1)"
  []
  (Math/abs
    (inc (* 0.5
            (Math/sqrt (* -2 (Math/log (rand))))
            (Math/cos (* 2 Math/PI (rand)))))))

(defn random-matrix-helper
  "Helper function for `random-matrix`"
  [size]
  (let [[now & later] size]
    (if (empty? later)
      (vec (repeatedly now truncated-random-normal))
      (vec (repeatedly now #(random-matrix-helper later))))))

(defn random-matrix
  "Generates a random matrix of size `size`, and magnitude.  Default magnitude=1e-5"
  ([size] (random-matrix size 1e-5))
  ([size magnitude]
   (cm/mul magnitude
           (matrix (random-matrix-helper size)))))
