;; @@
(defn expand-rows
  "Creates a matrix by repeating a given row n-times"
  [row n-times]
  (matrix (repeat n-times (cm/as-vector row))))

(defn sum-rows
  "Sums the rows of a matrix"
  [mat]
  (reduce cm/add mat))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;radioactive-winds/sum-rows</span>","value":"#'radioactive-winds/sum-rows"}
;; <=

;; @@
(defn is-positive-mask
  " Returns a matrix where the i,j index is a 0 if the i,j index of the original matrix is negative, and 1 otherwise.
  Input: [N,W]
  Returns: [N,W]"
  [mat]
  (matrix
    (for [i (range (count mat))]
      (for [j (range (count (first mat)))]
        (if
          (< (cm/mget mat i j) 0)
          0.0
          1.0)))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;radioactive-winds/is-positive-mask</span>","value":"#'radioactive-winds/is-positive-mask"}
;; <=

;; **
;;; ## Layers (Forward and Backward)
;; **

;; @@
(defn fc-forward
  " Applies an affine transformation to the input.  This looks like WX+B, where X is the input, W is the weights, B is the biases.  Returns this value, along with a cache of local gradients to be used in backpropagation.
  Input:
  	input: [N,A]
  	weights: [A,B]
  	biases: [B]
  Returns:
  	{:out [N,B],
  	:cache: {:X [N,A], :W [A,B]}}"
  [input vars]
  (let [{weights :weights biases :biases} vars
        [N A] (cm/shape input)
        multed (cm/mmul input weights)
        biased (cm/add multed (expand-rows biases N))]
    {:cache {:X input, :W weights}
     :out biased}))

(defn fc-backward
  "Given the cache from `fc-forward`, and the upstream gradient, returns the gradients w.r.t. the weights and biases along with the gradient w.r.t. the `fc-forward` operation."
  [grad-out, cache]
  (let [{X :X, W :W} cache]
    {:grad-vars {:biases (sum-rows grad-out),
                 :weights (cm/mmul (cm/transpose X) grad-out)}
     :grad-in (cm/mmul grad-out (cm/transpose W))}))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;radioactive-winds/fc-backward</span>","value":"#'radioactive-winds/fc-backward"}
;; <=

;; @@
(defn fc-relu-forward
  " Applies the transformation described in `fc-forward`, followed by a ReLU.  Returns this value, along with a cache of local gradients to be used in backpropagation.
  Input:
  	input: [N,A]
  	weights: [A,B]
  	biases: [B]
  Returns:
  	{:out [N,B],
  	:cache: {:mask [N,B], :fc-cache {:X [N,A], :W [A,B]}}}"
  [input vars]
  (let [{biased :out, cache :cache} (fc-forward input vars)
        mask (is-positive-mask biased)]
    {:out (cm/mul biased mask)
     :cache {:fc-cache cache, :mask mask}}))

(defn fc-relu-backward
  "Given the cache from `fc-relu-forward`, and the upstream gradient, returns the gradients w.r.t. the weights and biases along with the gradient w.r.t. the `fc-forward` operation."
  [grad-out, cache]
  (let [{fc-cache :fc-cache, mask :mask} cache
        relu-grad-in (cm/mul grad-out mask)]
    (fc-backward relu-grad-in fc-cache)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;radioactive-winds/fc-relu-backward</span>","value":"#'radioactive-winds/fc-relu-backward"}
;; <=

;; **
;;; ## Loss function (Forward and Backward)
;; **

;; @@
(defn softmax-log-loss
  "Calculates the data loss along with the gradient w.r.t. the data loss"
  [logits labels]
  (let [N (count labels)
        probs (matrix (mapv
                        (fn [row] (let [row (cm/sub row (+ 1e-8 (cm/emax row))) ;; numerical stability
                                        exp (cm/exp row)]
                                    (cm/div exp (cm/esum exp))))
                        logits))
        correct (matrix (mapv #(nth %1 %2) probs labels))
        loss (cm/negate (cm/log correct))
        loss (/ (cm/esum loss) N)]
    {:out loss
     :cache {:logit-grad (cm/mul (/ 1 N)
                                 (update-in-matrix probs
                                                   (partial + -1)
                                                   (map list (range N) labels)))}}))

(defn test-softmax-loss
  "Test for the `softmax-log-loss` function"
  []
  (let [{out :out} (softmax-log-loss (random-matrix [42 10]) (repeat 42 1))
        difference (Math/abs (+ out (Math/log 0.1)))]
    (println "Loss is correct:" (< difference 1e-4))))

